import { Injectable } from '@angular/core';
import axios from 'axios';
import { HttpClient } from '@angular/common/http';
import { Observable, Subscriber } from 'rxjs';

@Injectable({
  providedIn: 'root'
})
export class ServiceService {
data:any;
  constructor(private http:HttpClient) { }

public getUsers():Observable<[]> {
  this.data =  axios.get('http://localhost:9000/api/users')
  .then(response => {
    // Handle the response data here
    console.log(response.data);
  })
  .catch(error => {
    // Handle any errors here
    console.error(error);
  });

  return this.data;
  }

  public postData(){
      this.http.post('http://localhost:9000/api/users',{
        name: String,
        register: { type: String,  require: true },
        genre: { type: String, require:false,default:"Masculin" },
        photo: { type: String, require:false,default:"../avatar.png" },
        dateN: { type: Date, require:false },
        adresse: { type: String, require:true },
        role: { type: String, require:false, default:"Student" },
        father: { type: String, require:false },
        profession: { type: String, require:false },
        nationalid: { type: String, require:false },
        education: { type: String, require:false },
        mobile: { type: String, require:false },
        email: { type: String, require:false },
      })
  }

}
